import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="App">
       <BrowserRouter>
    <Routes>

      <Route path="/" element={<App />} />
      <Route path="/login" element={<Login />} /> 
    </Routes>

    </BrowserRouter>
    </div>
  );
}

export default App;
